import React from 'react';
import ReactDOM from 'react-dom';

const Modal = (props) => {
	return ReactDOM.createPortal(
		<div style={{ backgroundColor: '#fff' }}>teste</div>,
		document.querySelector('#modal')
	);
};

export default Modal;
